package main

import (
	"sort"
)

// ByLength filters, sorts, reverses, and maps integers to their word representations.
// It processes integers between 1 and 9 inclusive.
// - Filters out numbers not in the range [1, 9].
// - Sorts the remaining numbers in ascending order.
// - Reverses the sorted array.
// - Replaces each number with its corresponding English word ("One", "Two", etc.).
//
// For example:
// arr = [2, 1, 1, 4, 5, 8, 2, 3]
// -> filtered: [2, 1, 1, 4, 5, 8, 2, 3]
// -> sorted:   [1, 1, 2, 2, 3, 4, 5, 8]
// -> reversed: [8, 5, 4, 3, 2, 2, 1, 1]
// -> result:   ["Eight", "Five", "Four", "Three", "Two", "Two", "One", "One"]
func ByLength(arr []int) []string {
	// Define the mapping from digit to its English name.
	// Index 0 is unused, so digit `n` corresponds to `digitNames[n]`.
	digitNames := []string{"", "One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine"}

	// 1. Filter: Keep only integers that are between 1 and 9 inclusive.
	filteredNumbers := []int{}
	for _, num := range arr {
		if num >= 1 && num <= 9 {
			filteredNumbers = append(filteredNumbers, num)
		}
	}

	// If no numbers remain after filtering, return an empty string slice.
	if len(filteredNumbers) == 0 {
		return []string{}
	}

	// 2. Sort the filtered integers in ascending order.
	sort.Ints(filteredNumbers)

	// 3. Reverse the resulting array.
	// We can do this in-place.
	for i, j := 0, len(filteredNumbers)-1; i < j; i, j = i+1, j-1 {
		filteredNumbers[i], filteredNumbers[j] = filteredNumbers[j], filteredNumbers[i]
	}

	// 4. Replace each digit by its corresponding name.
	result := make([]string, len(filteredNumbers))
	for i, num := range filteredNumbers {
		// Since `num` is guaranteed to be between 1 and 9 due to filtering,
		// `digitNames[num]` is a safe and valid access.
		result[i] = digitNames[num]
	}

	return result
}
